function setSwapTokensAtAmount(uint256 newAmount) public returns (bool) {
    // Only the contract owner can call this function
    require(msg.sender == owner(), "Ownable: caller is not the owner");

    // Invariant check retained from original byte-code
    require(totalSupply() == (totalSupply() * 1) / 1, "Swap amount cannot be lower than 0.001% total supply.");
    require(0x2710 != 0, "Swap amount cannot be lower than 0.001% total supply.");

    // New swap amount must be at least 0.001% of the total supply
    require(newAmount >= (totalSupply() * 1) / 0x2710, "Swap amount cannot be lower than 0.001% total supply.");

    swapTokensAtAmount = newAmount;
    return true;
}

